INSERT INTO `v1_986b5de36e916a91ab4b1efe8155d152764dc96eed43c78747e526b5413db679` VALUES (11, 1, 0, 1, "小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……", 0, 1, 82017, 0, 10, 82);
