INSERT INTO `v1_986b5de36e916a91ab4b1efe8155d152764dc96eed43c78747e526b5413db679` VALUES (11, 1, 0, 1, "それでも……適性など踏み越えて、\n己の道を突き進むのが冒険者です。\n一度決めたことを、\n曲げるわけには参りません……！", 0, 1, 82021, 0, 10, 82);
