INSERT INTO `v1_986b5de36e916a91ab4b1efe8155d152764dc96eed43c78747e526b5413db679` VALUES (11, 1, 0, 1, "柔和で、寛容で、お話のわかる……\n彼女こそ、真の保育士さんで\nいらっしゃいますね。", 0, 1, 82029, 0, 10, 82);
